export default function Cube () {
  return (
    <div style={{ height: '120px', width: '120px' }}>
        <div class='face-front'
            style={{border:'solid', borderWidth:'0.1.px', transformStyle: 'preserve-3d'}}
        >
            Test
        </div>
    </div>
  );
}
